import React from 'react';
import { useRouter } from 'next/router';

const Details = ({ query }) => {
  console.log(query);

  return (
    <h1>Details</h1>
  )
};

Details.getInitialProps = () => {
  const router = useRouter();
  const query = router.query;

  return { query };
}

export default Details;
